 * Integration test for authentication in {@link DockerSlice}.
 *
 * @checkstyle ClassDataAbstractionCouplingCheck (500 lines)
 * @since 0.4
 */
@SuppressWarnings("PMD.AvoidDuplicateLiterals")
@DockerClientSupport
final class DockerAuthITCase {
    /**
     * Docker client.
     */
    private DockerClient cli;

    /**
     * Docker repository.
     */
    private DockerRepository repo;

    @Test
    void shouldPush() throws Exception {
        final Image original = new Image.ForOs();
        final String image = this.copy(original);
        final String output = this.cli.run("push", image);
        MatcherAssert.assertThat(output, new StringContains(false, String.format("latest: digest: %s", original.digest())));
    }
}

